func (dps *DatasetParamsSelect) sqlScan(ctx context.Context, v interface{}) error {
	rows := &sql.Rows{}
	query, args := dps.sqlQuery().Query()
	if err := dps.driver.Query(ctx, query, args, rows); err != nil {
		return err
	}
	defer rows.Close()
	return sql.ScanSlice(rows, v)
}

func (dps *DatasetParamsSelect) sqlQuery() sql.Querier {
	selector := dps.sql
	selector.Select(selector.Columns(dps.fields...)...)
	return selector
}
